import React, { useState, useEffect, useCallback } from "react";
import { Card, CardBody, Row, Col } from "reactstrap";
import axios from "axios";
import jwt from 'jsonwebtoken';

function Preview() {
  const [userData, setUserData] = useState();
  const [profiles, setProfiles] = useState([]);
  const [userCard, setUserCard] = useState([]);

  const fetchProfile = useCallback(() => {
    axios.get(`http://localhost:3001/user/preview/${userData.userId}`, { withCredentials: true })
      .then(response => {
        if (response && response.data) {
          setProfiles(response.data);
          console.log("response", response.data);
        } else {
          console.error('Empty response or invalid data received');
          // Handle the case where response or data is empty or invalid
        }
      })
      .catch(error => {
        console.error('Error fetching profile:', error);
        // Handle API call errors
      });
  }, [userData]);

  const fetchUserCard = useCallback(() => {
    axios.get(`http://localhost:3001/user/preview-card/${userData.userId}`, { withCredentials: true })
      .then(response => {
        if (response && response.data) {
          setUserCard(response.data);
          console.log("response", response.data);
        } else {
          console.error('Empty response or invalid data received');
          // Handle the case where response or data is empty or invalid
        }
      })
      .catch(error => {
        console.error('Error fetching profile card:', error);
        // Handle API call errors
      });
  }, [userData]);

  useEffect(() => {
    const token = localStorage.getItem('token') || document.cookie.replace(/(?:(?:^|.*;\s*)token\s*=\s*([^;]*).*$)|^.*$/, "$1");
    if (token) {
      const decoded = jwt.decode(token);
      setUserData(decoded);
    }
  }, []);

  useEffect(() => {
    if (userData) {
      fetchProfile();
      fetchUserCard();
    }
  }, [userData, fetchProfile, fetchUserCard]);
  // Function to format image paths
  const formatImagePath = (path) => {
    if (typeof path === 'string') {
      return path.split('\\').join('/');
    }
    return ''; // Return empty string for non-string values
  };


  return (
    <div className="content">
      <Row >
        {/* {profiles.map(profile => ( */}
            <Card className="card-stats" style={{margin:'auto'}}>
              <CardBody>
                <div>
                <div style={{ position: 'relative', width: '300px', height: 'auto' }}>
                  <img 
                    src={`http://localhost:3001/${formatImagePath(userCard.cardCover)}`} 
                    alt="CoverPic" 
                    width="300" 
                    height="auto" 
                    style={{ position: 'relative' }}
                  />
                  <div style={{ position: 'absolute', zIndex: 1, top: '-8em', left: '75px' }}>
                    <img
                      src={`http://localhost:3001/${formatImagePath(userCard.cardProfile)}`}
                      alt="ProfilePic"
                      width="150"
                      height="auto"
                      style={{ borderRadius: '50%' }}
                    />
                  </div>
                </div>

                <h6 align="center" className="prod-name" style={{ textDecoration: 'none' }}>
                    {profiles.username}
                  </h6>
                <h6 align="center" className="prod-name" style={{ textDecoration: 'none' }}>
                    {profiles.firstname}
                  </h6>
                  <h6 align="center" className="prod-name" style={{ textDecoration: 'none' }}>
                    {profiles.middlename}
                  </h6>
                  <h6 align="center" className="prod-name" style={{ textDecoration: 'none' }}>
                    {profiles.lastname}
                  </h6>
                  <h6 align="center" className="prod-name" style={{ textDecoration: 'none' }}>
                    {profiles.phone}
                  </h6>
                  <h6 align="center" className="prod-name" style={{ textDecoration: 'none' }}>
                    {profiles.email}
                  </h6>
                  <h6 align="center" className="prod-name" style={{ textDecoration: 'none' }}>
                    {profiles.organization}
                  </h6>
                  <h6 align="center" className="prod-name" style={{ textDecoration: 'none' }}>
                    {userCard.facebook}
                  </h6>
                  <h6 align="center" className="prod-name" style={{ textDecoration: 'none' }}>
                    {userCard.instagram}
                  </h6>
                  <h6 align="center" className="prod-name" style={{ textDecoration: 'none' }}>
                    {userCard.youtube}
                  </h6>
                  <h6 align="center" className="prod-name" style={{ textDecoration: 'none' }}>
                    {userCard.spotify}
                  </h6>
                  <h6 align="center" className="prod-name" style={{ textDecoration: 'none' }}>
                    {userCard.twitter}
                  </h6>
                  <h6 align="center" className="prod-name" style={{ textDecoration: 'none' }}>
                    {userCard.mode}
                  </h6>
                  <h6 align="center" className="prod-name" style={{ textDecoration: 'none' }}>
                    {userCard.theme}
                  </h6>
                  {/* Render other profile data here */}
                </div>
              </CardBody>
            </Card>
        {/* ))}  */}
      </Row>
    </div>
  );
}

export default Preview;
